<template>
    <div @dblclick="hide" class="img-area">
        <img :src="'data:image/png;base64,' + (imgBase64 ? imgBase64 : defaultImgBase64)" />
    </div>
</template>

<script>
    export default {
        name: "img-area",
        props: ["imgBase64"],
        data() {
            return {
                defaultImgBase64: "",
            };
        },
        methods: {
            hide() {
                this.$parent.imgAreaShow = false;
            }
        }
    }
</script>

<style scoped>
    .img-area {
        margin: 15px 0 15px 0;
    }
</style>
